import React from 'react';
import { Button, styled, Stack, Box } from '@mui/material';
import { Link } from "react-router-dom";

const ColorButton = styled(Button)(({ theme }) => ({
    color: 'black',
    font: 'bold',
    fontSize: '1.5rem',
    fontWeight: 'bold',
    fontFamily: 'Bitter',
    '&:hover': {
        background: "rgb(0, 206, 209,.3)",
        variant: 'outlined',
        focusRipple: true,
    },
}));

export default function NavButtons(from) {
    if (from === 'random') {
        return (
            <>
                <Stack
                    direction="row"
                    spacing={2}
                    alignItems="space-evenly">
                    <Link to='/author'>
                        <ColorButton>
                            Author
                        </ColorButton>
                    </Link>
                    <Link to='/category'>
                        <ColorButton>
                            Category
                        </ColorButton>
                    </Link>
                </Stack>
            </>
        )
    }
    else if (from === 'author') {
        return (
            <>
                <Stack
                    direction="row"
                    spacing={2}
                    alignItems="flex-start">
                    <Link to='/random'>
                        <ColorButton>
                            Random
                        </ColorButton>
                    </Link>
                    <Link to='/category'>
                        <ColorButton>
                            Category
                        </ColorButton>
                    </Link>
                </Stack>
            </>
        )
    }
    else if (from === 'category') {
        return (
            <>
                <Stack
                    direction="row"
                    spacing={2}
                    alignItems="flex-end">
                    <Link to='/random'>
                        <ColorButton>
                            Random
                        </ColorButton>
                    </Link>
                    <Link to='/author'>
                        <ColorButton>
                            Author
                        </ColorButton>
                    </Link>
                </Stack>
            </>
        )
    }
    else {
        return (
            <>
                <Box sx={{
                    boxShadow: 5,
                    borderRadius: 2,
                    // p: 2,
                    m: 'auto',
                    maxWidth: 500,
                    minWidth: 100,
                    justifyContent: 'center',
                }}>
                    <Stack
                        direction="row"
                        spacing={5}
                        alignItems="flex-end">
                        <Link to='/random'>
                            <ColorButton>
                                Random
                            </ColorButton>
                        </Link>
                        <Link to='/author'>
                            <ColorButton>
                                Author
                            </ColorButton>
                        </Link>
                        <Link to='/category'>
                            <ColorButton>
                                Category
                            </ColorButton>
                        </Link>
                    </Stack>
                </Box>
            </>
        )
    }
}
